import React, { Component } from 'react';
import './Board.css'; 
import Square from '../Square/Square';


class Board extends Component {
	constructor(){
		super();
	}


	renderSquare(){
	    return (
	      <Square />
	    );  
	}

	render(){
		return (
			<div id="board"> 
				{this.renderSquare()}
			</div>
		);
	}
}
export default Board;
